import React from "react";

class GetInTouch extends React.Component {
  render() {
    return (
      <div
        id="getintouch"
        style={MainDiv}
        data-aos="fade-down"
        data-aos-duration="9000"
      >
        <div style={Heading}>
          <div>Get in touch</div>
        </div>
        <div className=" row d-flex justify-content-center">
        <div
          className="card"
          data-aos="zoom-in"
          style={{
            // backgroundColor: "#F8DD74",
            width: "650px",
            height: "200px",
            border: "none",
            marginBottom: "20px",
            display: "flex",
            flexDirection: "row",
            justifyContent: "space-around",
            alignItems: "center",
            borderStyle: "solid",
            borderColor: "#193964",
            borderWidth: "8px",

          }}
        ></div>
        </div>
      </div>
    );
  }
}
const MainDiv = {
  marginTop: "70px",
};

const Heading = {
  justifyContent: "center",
  display: "flex",
  fontWeight: "bold",
  fontSize: "40px",
  fontFamily: "playfair display",
  color: "#193964",
  padding: "3%",
};

export default GetInTouch;
